#PRIMERA PARTE: ¬øQu√© palabras se repiten m√°s en los t√≠tulos del cine peruano encontrados en FilmAffinity?

# 1) Importar librer√≠as necesarias

import pandas as pd
import matplotlib.pyplot as plt
from wordcloud import WordCloud
import string

# 2) Crear variable "df(data frame)". Cargar datos desde GitHub.
df = pd.read_excel(url_github)


# 3) Obtener los t√≠tulos
titulos = df['titulo'].astype(str)

# 4) Estandarizar los t√≠tulos

  # Unir todos los t√≠tulos en un solo texto
texto = ' '.join(titulos).lower()

  # Quitar signos de puntuaci√≥n
for signo in string.punctuation:
    texto = texto.replace(signo, '')

# 5) Crear lista de palabras de stopwords
stopwords = ['el', 'la', 'de', 'y', 'en', 'un', 'una', 'por', 'con', 'los', 'las',
             'al', 'del', 'se', 'que', 'su', 'lo', 'como', 'ya', 'es',
             'film', 'pel√≠cula', 'pel√≠culas', 'sin', 'entre', 'para', 'm√°s', 'hay', 'nos', 'hasta', 'mis', 'qu√©', 'donde']

# 6) Filtrar palabras
palabras = texto.split()
palabras_filtradas = [p for p in palabras if p not in stopwords and p.isalpha() and len(p) > 2]

# 7) Generar nube de palabras
wordcloud = WordCloud(width=1000, height=500, background_color='white', colormap='plasma').generate(' '.join(palabras_filtradas))

# 8) Mostrar el gr√°fico
plt.figure(figsize=(15, 5))
plt.imshow(wordcloud, interpolation='bilinear')
plt.axis('off')
plt.title('Palabras m√°s frecuentes en t√≠tulos de pel√≠culas peruanas encontradas en FilmAffinity')
plt.show()

#SEGUNDA PARTE: ¬øQu√© cambios se observan en el uso de palabras en los t√≠tulos durante el periodo 2017‚Äì2025?

# 1) Importar librer√≠as necesarias
import pandas as pd
import matplotlib.pyplot as plt
import string
from collections import Counter

# 2) Mencionar la variable 'df' nuevamente para mantener el orden y evitar errores --> Cargar datos
df = pd.read_excel(url_github)

# 3) Definimos listas iniciales

    # Definir lista de a√±os de la base de datos
anios = [2017, 2018, 2019, 2020, 2021, 2022, 2023, 2024, 2025]

    # Definir lista de stopwords (palabras que no deseamos)
stopwords = ['el', 'la', 'de', 'y', 'en', 'un', 'una', 'por', 'con', 'los', 'las','al', 'del', 'se', 'que', 'su', 'lo', 'como', 'ya', 'es','film', 'pel√≠cula', 'pel√≠culas', 'sin', 'entre','para', 'm√°s','hasta', 'hay']

# 4) Crear lista vac√≠a para filtrar palabras de los t√≠tulos por a√±o
todas_las_palabras = []

# 5) Recorremos todos los a√±os
for anio in anios:
    titulos = df[df['a√±o'] == anio]['titulo']

    texto = ''
    for titulo in titulos:
        texto = texto + ' ' + str(titulo)

# 6) Estandarizar el texto
    texto = texto.lower()                   # convertimos a min√∫sculas
    for signo in string.punctuation:        # eliminamos signos de puntuaci√≥n con string
        texto = texto.replace(signo, '')

    #Convertimos a lista
    palabras = texto.split()

# 7) Filtrar palabras de la lista
    for palabra in palabras:
        if palabra.isalpha() and len(palabra) > 2:    # verifica que cada palabra contengan solo letras y que tenga m√°s de dos caracteres
            if palabra not in stopwords:              # verifica que la palabra no se encuentre en palabras no deseadas
                todas_las_palabras.append(palabra)    # agrega las palabras filtradas a nueva lista 'todas_las_palabras'

# 8) Contar frecuencia de las palabras

  #Crear diccionario para contar cada palabra con su frecuencia respectiva
conteo_palabras = {}
  # Repasar la frecuencia de cada palabra de la lista para guardar en el diccionario
for palabra in todas_las_palabras:
    if palabra in conteo_palabras:
        conteo_palabras[palabra] += 1
    else:
        conteo_palabras[palabra] = 1

# 9) Ordenar el diccionario
