# Imprimir resultados
print("Frecuencia de las diez palabras m√°s destacadas en los t√≠tulos desde 2017 hasta 2025:")
print('')
for palabra, frecuencia in conteo_ordenado.items():
  print("-", f"{palabra}: {frecuencia}")

# 10) Creas listas para generar ordenar los datos para el gr√°fico

palabras = list(conteo_ordenado.keys())      #eje x del gr√°fico
frecuencias = list(conteo_ordenado.values())    # eje y del gr√°fico

# 11) Crear gr√°fico de barras
