#2) Importar librerias necesarias para el c√≥digo

import pandas as pd
from langdetect import detect
import matplotlib.pyplot as plt

#3)  Mencionar la variable 'df' nuevamente para mantener el orden y evitar errores --> Cargar datos.
df = pd.read_excel(url_github)


#4) Creamos contadores para cada lengua
conteo_espanol = 0
conteo_ingles = 0
otros = 0        #------> Este contador incluye lenguas como el quechua, aimara, entre otras.

#5) Utilizar 'for' para recorrer cada t√≠tulo

for titulo in df['titulo']:
    texto = str(titulo).strip()

    if len(texto.split()) < 2: ## si el titulo tiene menos de dos palabras
        otros += 1
    else:
        idioma = detect(texto)
        if idioma == 'es':
            conteo_espanol += 1
        elif idioma == 'en':
            conteo_ingles += 1
        else:
            otros += 1

#6) Imprimir resultados
print('')
print('Cantidad de t√≠tulos por lenguas')
print('')
print("T√≠tulos en espa√±ol:", conteo_espanol)
print("T√≠tulos en ingl√©s:", conteo_ingles)
print("T√≠tulos en quechua y otras lenguas nativas: ", otros)

#7) Establecer variables para crear gr√°fico de barras
etiquetas = ['Espa√±ol', 'Ingl√©s', 'Otros (Quechua y otras lenguas nativas)']
valores = [conteo_espanol, conteo_ingles, otros]

plt.figure(figsize=(15, 5))
plt.bar(etiquetas, valores, color=['orange', 'blue', 'green'])
plt.title("Lengua en los t√≠tulos")
plt.ylabel("Cantidad de t√≠tulos")
plt.grid(axis='y', linestyle='--', alpha=0.5)
plt.tight_layout()
plt.show()

